export default function Card() {
 return (
  <div>
   <p>Componentes:</p>
   <p>Facilita em manter partes menores funcionando corretamente</p>
   <p>Você pode reutilizá-los, ou seja, menos código para se escrever</p>
  </div>
 );
}
